ht.Default.setImage('floor', 'data:image/jpeg;base64,');
ht.Default.setImage('wall', 'data:image/jpeg;base64,');


function getRawText(obj){
    var text = String(obj); 
    return text.substring(14, text.length-3);
}   

function createModel(){
    wall = new ht.CSGShape();
    wall.setClosePath(true);
    wall.setTall(240);
    wall.setElevation(120);
    wall.setThickness(20);
    wall.setPoints([
        {x: -400, y: -400},
        {x: 400, y: -400},
        {x: 400, y: 400},
        {x: -400, y: 400}
    ]); 
    wall.s({
        'all.color': '#DDDDDD',
        '3d.selectable': false
    });
    dataModel.add(wall);  

    floor = new ht.Node();
    floor.s3(820, 0.1, 820);
    floor.s({
        'all.color': '#DDDDDD',
        '3d.selectable': false
    });
    dataModel.add(floor);

    for(var i=0; i<4; i++){
        var node = new ht.CSGNode();
        node.setHost(wall);
        node.s3(400, 120, 10);
        node.setElevation(120);
        node.s({
            'attach.index': i,
            'attach.offset': 0.5,
            'attach.offset.relative': true,
            'all.color': '#3498DB',
            'all.opacity': 0.5,
            'all.transparent': true,
            'all.reverse.cull': true,
            'all.visible': false,
            '3d.selectable': false
        });                
        if(i !== 2){
            node.s({
                'front.visible': true,
                'back.visible': true                           
            });
        }
        dataModel.add(node);                    
    }

    var modelMap = ht.Default.parseObj(scooter_obj, scooter_mtl, {center: true, cube: true});                  
    var array = [];
    var rawS3;
    for(var name in modelMap){ 
        var model = modelMap[name];
        rawS3 = model.rawS3;
        array.push(model);                                        
    }                 
    ht.Default.setShape3dModel('scooter', array);

    var node = new ht.Node();
    node.s({
        'shape3d': 'scooter',
        'select.brightness': null
    });                
    node.s3(rawS3[0]*20, rawS3[1]*20, rawS3[2]*20);  
    node.p3(-200, node.getTall()/2, -200);
    dataModel.add(node);     
}

function newLine(title){
    if(title){
        formPane.addRow([{ element: title, font: 'bold 12px arial, sans-serif' }], [0.1]);
    }    
    formPane.addRow([], [0.1], 1.01, {background: '#43AFF1'});    
}

function createTexturePane(){
    newLine('Texture');
    formPane.addRow([
        {
            id: 'wall',
            checkBox: {
                label: 'Wall',                            
                onValueChanged: function(){
                    if(this.getValue()){
                        wall.s({
                            'all.image': 'wall',
                            'all.uv.scale': [40, 5]
                        });
                    }else{
                        wall.s({
                            'all.image': null
                        });
                    }
                }
            }
        },
        {   
            id: 'floor',
            checkBox: {
                label: 'Floor',                            
                onValueChanged: function(){
                    if(this.getValue()){
                        floor.s({
                            'all.image': 'floor',
                            'all.uv.scale': [5, 5]
                        });
                    }else{
                        floor.s({
                            'all.image': null
                        });
                    }                                
                }
            }                        
        }
    ], [0.1, 0.1]);     
}

function createHeadlightPane(){                                                       
    newLine('Headlight');
    formPane.addRow([
        {
            checkBox: {
                label: 'Disabled',                            
                onValueChanged: function(){
                    g3d.setHeadlightDisabled(this.getValue());
                }
            }
        },
        {
            slider: {                    
                min: 0,
                max: 3500,                
                step: 100,
                value: g3d.getHeadlightRange(),
                onValueChanged: function(){     
                    g3d.setHeadlightRange(this.getValue());                                
                }
            }
        }
    ], [0.1, 0.15]);
}